import { Link } from 'react-router-dom';
import React from "react";
import "./MyPage.css"

function MyPage() {
    return(
        <div>
            <img src={process.env.PUBLIC_URL + '/image.png'} alt='프로필사진' />
            <button><Link className='editButton' to={'/edit-profile'}>수정하기</Link></button>
            <p>박범준</p>

            <Link className='mypage-navbar' to={'/mypage'}>홈</Link><br></br>
            <Link className='mypage-navbar' to={'/mypage-free'}>자유 게시글</Link>
            <Link className='mypage-navbar' to={'/mypage-question'}>질문 게시글</Link>
            <Link className='mypage-navbar' to={'/mypage-study'}>스터디 게시글</Link>
            <Link className='mypage-navbar' to={'/mypage-friend'}>친구 목록</Link>
        </div>
    );
}

export default MyPage;
